The following shows the complete logic implemented using fn_graph : # // [dependencies]
# // fn_graph = { version = "0.5.4", features = ["fn_meta", "resman"] }
# // futures = "0.3.21"
# // resman = { version = "0.15.0", features = ["fn_meta", "fn_res"] }
# // tokio = { version = "1.20.0", features = ["rt", "macros", "time"] }
# use std::{
# fmt,
# ops::{AddAssign, Deref, DerefMut},
# };
#
# use fn_graph::FnGraphBuilder;
# use futures::stream::StreamExt;
# use resman::{IntoFnRes, Resources};
#
// Define newtypes for each parameter.
#[derive(Debug)] struct A(u32);
#[derive(Debug)] struct B(u32);
#[derive(Debug)] struct C(u32);
#[derive(Debug)] struct D(u32); # fn main() {
// Initialize data.
let mut resources = Resources::new();
resources.insert(A(0));
resources.insert(B(0));
resources.insert(C(0));
resources.insert(D(0));
let resources = &resources; // Now the map is compile time immutable. # type Fn1 = fn(&mut A, &mut B, &mut C, &mut D);
# type Fn2 = fn(&A, &mut C);
# type Fn3 = fn(&B, &mut C);
# type Fn4 = fn(&C, &mut D);
# type Fn5 = fn(&A, &B, &C);
#
// Define logic and insert them into graph structure.
let fn_graph = { let fn1: Fn1 = |a, b, c, d| { a.0 = 1; b.0 = 2; c.0 = 0; d.0 = 0; }; let fn2: Fn2 = |a, c | *c += a.0; let fn3: Fn3 = | b, c | *c += b.0; let fn4: Fn4 = | c, d| *d += c.0; let fn5: Fn5 = |a, b, c | println!("{a} + {b} = {c}"); let mut fn_graph_builder = FnGraphBuilder::new(); // Store functions in graph. let [fn_id1, fn_id2, fn_id3, fn_id4, fn_id5] = fn_graph_builder.add_fns([ fn1.into_fn_res(), fn2.into_fn_res(), fn3.into_fn_res(), fn4.into_fn_res(), fn5.into_fn_res(), ]); // Define dependencies to control ordering. fn_graph_builder .add_logic_edges([ (fn_id1, fn_id2), (fn_id1, fn_id3), (fn_id2, fn_id4), (fn_id2, fn_id5), (fn_id3, fn_id4), (fn_id3, fn_id5), ]) .unwrap(); fn_graph_builder.build()
}; // Invoke logic over data.
//
// For synchronous sequential execution, you may uncomment the next line:
// fn_graph.iter().for_each(|fun| fun.call(resources));
//
// For asynchronous concurrent execution, use the following:
let rt = tokio::runtime::Builder::new_current_thread() .enable_time() .build() .unwrap();
rt.block_on(async move { fn_graph .stream() .for_each_concurrent(None, |fun| async move { fun.call(resources); }) .await;
}); // prints:
