Now that we can easily hold different types under the Box<dyn FnRes> abstraction, the remaining issue is to invoke the logic through that common abstraction. To do this, FnRes has a method that takes a &Resources parameter, and each trait implementation will handle parameter fetching and function invocation: // Trait for all logic types to implement.
pub trait FnRes { /// Return type of the function. type Ret; /// Runs the function. fn call(&self, resources: &Resources) -> Self::Ret;
} // Implementation to fetch the parameters from `Resources`, and invoke the function.
impl<Fun, Ret, C, A> FnRes for FnResource<F, Ret, (&mut C, &A)>
where Fun: Fn(&mut C, &A) -> Ret + 'static, Ret: 'static,
{ pub fn call(&self, resources: &Resources) -> Ret { let c = resources.borrow_mut::<C>(); let a = resources.borrow::<A>(); (self.func)(c, a) }
} With this, consumers are able to invoke functions generically: let mut resources = Resources::new();
resources.insert(A::new(1));
resources.insert(C::new(0)); let fn_res: Box<dyn FnRes> = (|c: &mut C, a: &A| *c += *a).into_fn_res(); // Generically invoke logic with generic data type.
fn_res.call(&resources); Notably: Parameters must be &T or &mut T, as T is owned by Resources . Parameters must be distinct types, as it is invalid to borrow &mut T twice. Borrowing and invocation is implemented by the function type – FnResource in this example. Out of the box, this lives in the resman crate instead of fn_graph . 1 resman implements FnRes for functions with up to 6 parameters.

