} But that constrains the signature of each sub function to be the same. A type parameterized function chain – where the return value of one function is the parameter to the next – may be messy, especially for error messages. For spinners, manually ticking the progress bar can be cumbersome, but automatic ticking will give a false impression of progress happening. Somewhat mitigated by stall detection. Codegen to add progress ticks This could be done with a proc macro that counts the number of expressions, with some clever handling of conditionals, and inserts tick() expressions. For now Peace will require implementors to manual tick the progress, and in the future, explore the following option: Trait to automatically tick progress for iterators. Proc macro to automatically insert ticks.
